var ParsedResult = require('../../result').ParsedResult;

var PATTERN = new RegExp('(\\W|^)' +
    '(?:' +
        '((?:domingo|dom|lunes|lun|martes|mar|mi[ée]rcoles|mie|jueves|jue|viernes|vie|s[áa]bado|sab))' +
        '\\s*\\,?\\s*' +
    ')?' +
    '([0-9]{1,2})[\\/\\.\\-]([0-9]{1,2})' +
    '(?:' +
        '[\\/\\.\\-]' +
        '([0-9]{4}|[0-9]{2})' +
    ')?' +
    '(\\W|$)', 'i');

